def gerar_placa_antiga():
    letras = ''.join(random.choices(string.ascii_uppercase, k=3))
    numeros = ''.join(random.choices(string.digits, k=4))
    return letras + "" + numeros

def gerar_placa_mercosul():
    letras = ''.join(random.choices(string.ascii_uppercase, k=3))
    digito = random.choice(string.digits)
    letra_meio = random.choice(string.ascii_uppercase)
    ultimos_digitos = ''.join(random.choices(string.digits, k=2))
    return letras + digito + letra_meio + ultimos_digitos

def gerar_placa_moto(tipo: str) -> str:
    if "mercosul" in tipo.lower():
        # Padro Mercosul: ABC1D23 -> quebra para ABC\n1D23
        letras1 = ''.join(random.choices(string.ascii_uppercase, k=3))
        digito1 = random.choice(string.digits)
        letra2 = random.choice(string.ascii_uppercase)
        digitos_finais = ''.join(random.choices(string.digits, k=2))
        return f"{letras1}\n{digito1}{letra2}{digitos_finais}"
    else:
        # Padro Antigo: ABC1234 -> quebra para ABC\n1234
        letras = ''.join(random.choices(string.ascii_uppercase, k=3))
        numeros = ''.join(random.choices(string.digits, k=4))
        return f"{letras}\n{numeros}"

class HoverButton(QPushButton):
    def __init__(self, text="", icon_path=None, parent=None):
        super().__init__(text, parent)
        self.default_style = "background-color: #444; color: white; border: 1px solid #555;"
        self.hover_style = "background-color: #666; color: white; border: 1px solid #777;"
        self.setStyleSheet(self.default_style)
        self.setCursor(Qt.PointingHandCursor)
        self.installEventFilter(self)

        if icon_path:
            self.setIcon(QIcon(icon_path))
            self.setIconSize(QSize(16, 16))

    def eventFilter(self, obj, event):
        if event.type() == QEvent.Enter:
            self.setStyleSheet(self.hover_style)
        elif event.type() == QEvent.Leave:
            self.setStyleSheet(self.default_style)
        return super().eventFilter(obj, event)

